import './App.css';
import React from 'react';



function App() {
  const state ={
    name: '',
    selectedFile: null
  }

  const handleChange = input=> e =>{
    this.setState({[input]: e.target.value});
  }  

  const {name, selectedFile} = this.state;
  const values = {name, selectedFile};

  return (
    <div className="App">
      <form>
        <input
          type="text"
          value={name}
          onChange={handleChange}
        />

        <input
          type="file"
          value={selectedFile}
          onChange={handleChange}
        />
      </form>
    </div>
  );
}

export default App;
